css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

/* blue fix */
div.search_form_row {background-color: rgba(100,100,100,0.8)}
div.l-header .selection_nipple {border-bottom-color: rgba(100,100,100,0.8)}

#left_column, #right_column {
	background-color: transparent;
}
.controls_section.user_list li.item .follow_list_item_blog:before {
  background-image: none;
  border-right: none;
  }
.radar div.radar_footer .radar_avatar:before {
  background-image: none;
  }
#right_column:after {display:none}

.blog.has_follow_button:before,
#right_column:after {display: none}

BODY:not(.mceContentBody), #new_post.editing {
	background: url('data:image/jpeg;base64,') !important;
}

.new_post .title, .new_post .tag_editor {
	background-color: rgba(255,255,255,1) !important;
}

div.l-content.l-content.l-content.l-content {
	background: rgba(100,100,100,0.8);
}

#dashboard_edit_post {
	background-color: #ffffff !important;
}

#right_column .dashboard_nav_item {
	border-bottom: 0px solid #eee !important;
	background-image: none  !important;
}

#right_column .dashboard_nav_item .dashboard_nav_title,
	#right_column .dashboard_nav_item .dashboard_nav_title a,
	#right_column .dashboard_nav_item a,
	#right_column .dashboard_nav_item ul.dashboard_subpages,
	#right_column .dashboard_nav_item ul.dashboard_subpages li a {
	color: #fff !important;
}

#right_column .dashboard_nav_item ul.dashboard_subpages li a.tracked_tag_control {
	color: #888 !important;
}

#right_column .dashboard_nav_item #dashboard_controls_radar_media_fold {
	background: none !important;
}

#left_column #posts .notification .avatar {
	border-color: transparent !important;
	background-color: #fbfbfb !important;
	opacity: 0.5 !important;
}

#left_column #posts .notification .avatar:hover {
	opacity: 1 !important;
}

.dashboard_switch_blog_menu_header {
	background-color: #fbfbfb !important;
	color: #666 !important;
}

.dashboard_switch_blog_menu_item {
	background-color: #fbfbfb !important;
	color: #666 !important;
	border: 0px !important;
}

.dashboard_switch_blog_menu_footer {
	background-color: #fbfbfb !important;
	color: #666 !important;
}

.dashboard_switch_blog_menu_wrapper {
	background-color: #fbfbfb !important;
}

#new_post_notice_container {
	color: #fff !important;
}

#new_post_notice_container a {
	color: #fff !important;
}

#dashboard_switch_blog_menu_current,
#dashboard_switch_blog_arrow_and_divider,
#dashboard_switch_blog_arrow_current {
	background-image: none !important;
}

.new_post .new_post_label/*_icon*/ > I {
	background: url('http://i28.tinypic.com/1h32ud.jpg') no-repeat !important;
	z-index: -1;
	transition: background-position .2s linear !important;
}

.new_post_label {
	font-size: 14px !important;
/*	padding-top: 10px !important;*/
	padding: 4px 1px 75px 0 !important;
	font-family: Georgia, Times New Roman, sans-serif !important;
	font-style: italic !important;
	text-transform: lowercase !important;
	color: #222 !important;
	letter-spacing: 1px !important;
}

.new_post_label:nth-of-type(1) > I {background-position: 2px 16px !important}
.new_post_label:nth-of-type(2) > I {background-position: -73px 16px !important}
.new_post_label:nth-of-type(3) > I {background-position: -148px 16px !important}
.new_post_label:nth-of-type(4) > I {background-position: -223px 16px  !important}
.new_post_label:nth-of-type(5) > I {background-position: -298px 16px !important}
.new_post_label:nth-of-type(6) > I {background-position: -373px 16px !important}
.new_post_label:nth-of-type(7) > I {background-position: -448px 16px  !important}

.new_post_label:nth-of-type(1):hover > I {background-position: 2px 0px !important}
.new_post_label:nth-of-type(2):hover > I {background-position: -73px 0px !important}
.new_post_label:nth-of-type(3):hover > I {background-position: -148px 0px !important}
.new_post_label:nth-of-type(4):hover > I {background-position: -223px 0px  !important}
.new_post_label:nth-of-type(5):hover > I {background-position: -298px 0px !important}
.new_post_label:nth-of-type(6):hover > I {background-position: -373px 0px  !important}
.new_post_label:nth-of-type(7):hover > I {background-position: -448px 0px  !important}

.new_post_label > I {
  color: transparent !important;
  transition: background-position .08s linear !important;
}

#left_column #posts .notification {
	background-color: #fbfbfb !important;
	color: #666 !important;
	border-bottom-color: #eee !important;
}

#left_column #posts .notification .block {
	color: #333 !important;
}

#left_column #posts .notification.alt {
	background-color: #f7f7f7 !important;
}

#left_column #posts .notification.last_notification,
	#left_column #posts .notification.single_notification {
	border-bottom-color: #ececec !important;
}

#left_column #posts .notification a {
	color: #565656 !important;
	border-bottom: 0px !important;
}

#left_column #posts .notification blockquote {
	border-left-color: #eee !important;
}

#left_column #posts .notification .avatar {
	border-color: transparent !important;
	background-color: #fbfbfb !important;
	opacity: 0.5 !important;
}

#left_column #posts .notification .avatar:hover {
	opacity: 1 !important;
}

.notification_type_icon {
	display: none !important;
}

}
